import Router from 'next/router'
import ReactMarkdown from 'react-markdown'

const Cameras = ({ cameras }) => {
  return (
    <div onClick={() => Router.push('/p/[id]', `/p/${cameras.id}`)}>
      <h4 style="display:inline">Nome:</h4> {cameras.cameraname}
      <h4>Número de série:</h4>  {cameras.serialnumber} 
      <h4>Fabricante:</h4> {cameras.manufacturer}
      <style jsx>{`
        div {
          color: inherit;
          padding: 1rem;
        }
      `}</style>
    </div>
  )
}

export default Cameras
